import React from 'react';
import Layout from '../../components/Layout';
import { Container } from 'react-bootstrap';



/** 
* @author
* @function Home
**/

const Home = (props) => {
    return (
        <Layout>
            <Jumbotro>
                <h1>Bienvenue sur le Tableau de Bord</h1>
            </Jumbotro>
        </Layout>
    );
};

export default Home;
